import React from 'react';
import Header from '../Header/Header';
import FormInput from '../FormInput/FormInput'
import Tasks from '../Tasks/Tasks'
import ToDoButtom from '../ToDoButton/ToDoButton';
import style from './Form.css'

const Form = ({listItems, clearInput,formInput,inputChange, addListItem, completedItem, removeItem}) => {
    return(
        <form className={style.form}>
           <Header/>
           <FormInput clearInput={clearInput} inputChange={inputChange}/>
           <Tasks listItems={listItems}
                   addListItem={addListItem}
                   completedItem={completedItem}
                   removeItem Item={removeItem}/>
            <ToDoButtom addListItem={addListItem}/>
        </form>
    )
}

export default Form;
